. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",vvc='Dimension',xhc='Dimension [height=',Lrc='DirectionalTextHelper',Orc='DockLayoutPanel',Prc='DockLayoutPanel$Direction',Qrc='DockLayoutPanel$Direction;',Trc='DockLayoutPanel$DockAnimateCommand',Rrc='DockLayoutPanel$LayoutData',_nc='DomEvent',eoc='DomEvent$Type',duc='Double',zec='EAST',u9b='EEE, d MMM yyyy HH:mm:ss Z',mkc='EEE. dd MMM. yyyy HH:mm:ss',O9b='EEEE, MMMM d',x9b='EEEE, MMMM d, y',V6b='EM',Ecc='EMPTY',Jcc='ENABLED',_ac='END',X6b='EX',uqc='ElementMapperImpl',vqc='ElementMapperImpl$FreeNode',Qac='English',lnc='Enum',Hac='Etc/GMT',Jac='Etc/GMT+',Iac='Etc/GMT-',o7b='Event type',jtc='Event$NativePreviewEvent',roc='EventBus',Bmc='EventObject',Gmc='Exception',fdc='Expecting version 6 from server, got ',l8b='F',vic='F8834F07517EF3B7D02B9E845E5E1B88',Q6b='FIXED',Ddc='FLOAT',dic='Fail: ',F8b='Feb',t8b='February',euc='Float',Urc='FlowPanel',trc='FocusWidget',zgc='For input string: "',h9b='Fri',a9b='Friday',C7b='GET',Dkc='GGD55XLBAH',imc='GGD55XLBAK',Clc='GGD55XLBBI',Pjc='GGD55XLBBJ',Ckc='GGD55XLBCH',Elc='GGD55XLBCI',gmc='GGD55XLBCK',fcc='GGD5
